import React from "react";

const List = ({ handleDelete, persons }) => {
  return (
    <>
      {persons.map((pers) => (
        <li key={pers.name}>
          <p>
            <span>{pers.name}</span>
            {": "}
            {pers.number}
            {"   "}
            <button onClick={handleDelete}>Delete</button>
          </p>
        </li>
      ))}
    </>
  );
};
export default List;
